import React, { useState } from 'react';

export default function VoiceAssistant() {
  const [status, setStatus] = useState('idle');
  const [transcript, setTranscript] = useState('');
  const [requirements, setRequirements] = useState([]);
  const [testCases, setTestCases] = useState([]);

  const handleStart = () => {
    setStatus('processing');
    setTimeout(() => {
      setTranscript(
        `Backlog refinement meeting agenda

Vision Alignment (2 mins)
Quickly revisit the broader company mission. What is our purpose and overarching goal?

Last Session Review (5 mins)
Reflect on the previous iteration or sprint:
• What were the achievements?
• What are the pending tasks and why?

New Items to Address (5 mins)
• Time to address emerging concerns:
• Any urgent bugs or defects identified?
• Any fresh feedback from users or stakeholders?
• Are there new features or requirements to consider?

Meeting Notes:
- Registration flow needs to be split into frontend and backend tasks.
- Payment integration requires additional validation steps.
- Timeline for both tasks is set for next sprint.
`
      );
      setRequirements([
        "Split registration flow into frontend and backend tasks",
        "Add validation steps to payment integration",
        "Set timeline for both tasks for next sprint"
      ]);
      setTestCases([
        "Test registration (frontend) with valid/invalid data",
        "Test registration API (backend)",
        "Test payment integration with valid/invalid payment details",
        "Test validation errors for payment"
      ]);
      setStatus('done');
    }, 1200);
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-black-200 to-black-400 flex flex-col items-center py-10 px-2">
      <div className="w-full max-w-3xl">
        <h1 className="text-3xl font-bold mb-6 text-gray-800 text-center">AI Voice Assistant</h1>
        <div className="flex justify-center mb-8">
          <button
            className="bg-blue-600 text-white px-6 py-2 rounded shadow hover:bg-blue-700 transition"
            onClick={handleStart}
            disabled={status === 'processing' || status === 'done'}
          >
            {status === 'idle' ? 'Start Meeting Assistant' : 'Processing...'}
          </button>
        </div>

        {/* Cards Section */}
        <div className="space-y-6">
          {/* Meeting Agenda Card */}
          <div className="bg-white rounded-xl shadow p-6">
            <h2 className="text-xl font-semibold mb-2 text-green-700">Backlog refinement meeting agenda</h2>
            <div className="bg-green-50 rounded p-4 mb-4">
              <h3 className="font-semibold text-green-800 mb-1">Vision Alignment <span className="text-gray-500">(2 mins)</span></h3>
              <p className="text-gray-700 mb-2">Quickly revisit the broader company mission. What is our purpose and overarching goal?</p>
            </div>
            <div className="bg-green-50 rounded p-4 mb-4">
              <h3 className="font-semibold text-green-800 mb-1">Last Session Review <span className="text-gray-500">(5 mins)</span></h3>
              <ul className="list-disc ml-6 text-gray-700">
                <li>What were the achievements?</li>
                <li>What are the pending tasks and why?</li>
              </ul>
            </div>
            <div className="bg-green-50 rounded p-4">
              <h3 className="font-semibold text-green-800 mb-1">New Items to Address <span className="text-gray-500">(5 mins)</span></h3>
              <ul className="list-disc ml-6 text-gray-700">
                <li>Time to address emerging concerns</li>
                <li>Any urgent bugs or defects identified?</li>
                <li>Any fresh feedback from users or stakeholders?</li>
                <li>Are there new features or requirements to consider?</li>
              </ul>
            </div>
          </div>

          {/* Meeting Notes Card */}
          {status === 'done' && (
            <div className="bg-white rounded-xl shadow p-6">
              <h2 className="text-lg font-semibold mb-2 text-green-700">Meeting Notes</h2>
              <ul className="list-disc ml-6 text-gray-700">
                <li>Registration flow needs to be split into frontend and backend tasks.</li>
                <li>Payment integration requires additional validation steps.</li>
                <li>Timeline for both tasks is set for next sprint.</li>
              </ul>
            </div>
          )}

          {/* Extracted Requirements Card */}
          {status === 'done' && (
            <div className="bg-white rounded-xl shadow p-6">
              <h2 className="text-lg font-semibold mb-2 text-blue-700">Extracted Requirements</h2>
              <ul className="list-disc ml-6 text-gray-700">
                {requirements.map((r, i) => (
                  <li key={i}>{r}</li>
                ))}
              </ul>
            </div>
          )}

          {/* Generated Test Cases Card */}
          {status === 'done' && (
            <div className="bg-white rounded-xl shadow p-6">
              <h2 className="text-lg font-semibold mb-2 text-purple-700">Generated Test Cases</h2>
              <ul className="list-disc ml-6 text-gray-700">
                {testCases.map((t, i) => (
                  <li key={i}>{t}</li>
                ))}
              </ul>
            </div>
          )}

          {/* Transcript Card */}
          {status === 'done' && (
            <div className="bg-white rounded-xl shadow p-6">
              <h2 className="text-lg font-semibold mb-2 text-gray-700">Full Meeting Transcript</h2>
              <pre className="bg-gray-50 rounded p-3 text-gray-800 whitespace-pre-wrap break-words">{transcript}</pre>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}
